import React from "react";
import "../styles/About.css";

function About() {
  return (
    <section className="about" id="about">
      <h2 className="section-title cursive">About Me</h2>
      <p className="about-text">
        I’m Zainab — a passionate front-end developer who loves turning pastel dreams into interactive websites.
        I specialize in React, Next.js, and creating experiences that feel magical yet functional.
        Currently balancing O-Levels with real-world development — and loving every second of it.
      </p>
    </section>
  );
}

export default About;
